// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract CubifoxToken is ERC721, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;

    Counters.Counter public tokenIdCounter;

    event requestedCollectible(uint256 indexed tokenId, address requester);

    struct Item {
        uint256 id;
        string uri;
    }

    constructor() ERC721("CubifoxToken", "CFX") {}

    function safeMint(string memory uri, address requester) public onlyOwner {
        uint256 tokenId = tokenIdCounter.current() + 1;
        tokenIdCounter.increment();
        _safeMint(requester, tokenId);
        _setTokenURI(tokenId, uri);
        emit requestedCollectible(tokenId, requester);
    }

    // The following functions are overrides required by Solidity.
    function _burn(uint256 tokenId)
        internal
        override(ERC721, ERC721URIStorage)
    {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }

    function fetchMyItems(address owner) public view returns (Item[] memory) {
        uint256 totalItemCount = tokenIdCounter.current();
        uint256 itemCount = 0;
        for (uint256 i = 0; i < totalItemCount; i++) {
            if (ownerOf(i + 1) == owner) {
                itemCount += 1;
            }
        }

        Item[] memory items = new Item[](itemCount);
        uint256 currentIndex = 0;
        for (uint256 i = 0; i < totalItemCount; i++) {
            uint256 itemId = i + 1;
            if (ownerOf(itemId) == owner) {
                Item memory foundItem = Item({
                    id: itemId,
                    uri: tokenURI(itemId)
                });
                items[currentIndex] = foundItem;
                currentIndex += 1;
            }
        }
        return items;
    }
}
